var Document;

Document = Backbone.Model.extend({
  download: function() {
    var blob, jsonContent;
    jsonContent = JSON.stringify(this.toJSON());
    blob = new Blob([jsonContent], {
      type: 'text/plain;charset=utf-8'
    });
    return saveAs(blob, this.get('document_chembl_id') + 'DocumentBasicInformation.txt');
  }
});
